const courses = [
    {
        _id: "123",
        title: "CS5610",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "234",
        title: "CS4500",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "456",
        title: "CS4800",
        owner:"me",
        lastOpened:"yesterday"
    },
    {
        _id: "345",
        title: "CS3200",
        owner:"me",
        lastOpened:"yesterday"
    }
]
const CourseListComponents = ({instructor, term}) => {
    return (
        <div>
        <h1>Course List(for{instructor}) {term}</h1>
        <table className= "table">
            {
                courses.map(item =>
                    <tr>
                        <td>{item.title}</td>
                        <td>{item.title}</td>
                        <td>{item.title}</td>
                    </tr>
                )
            }
        </table>
        </div>
    )
}

export default CourseListComponents;
